class Solution:
    def makeTheIntegerZero(self, num1: int, num2: int) -> int:
        if num2 == 0:
            return -1
        operations = 0
        while num1 != 0:
            if num1 < 0 and num2 > 0 or num1 > 0 and num2 < 0:
                return -1
            for i in range(60, -1, -1):
                power = 2 ** i
                if abs(num1) >= abs(power + num2):
                    num1 -= power + num2
                    operations += 1
                    break
            else:
                return -1
        return operations
